import {React, useState} from 'react';
import '../styles/textarea.css';

const e = React.createElement;

function Console(){

        const {value} = useState(0);

        const showValue = (val) => {
            return val.map(line=>{
                return line + '\n';
            });
        }

       return e('textarea',{
           className:'console',
           value:showValue(value)
       },)


}

export default Console;
